CREATE PROCEDURE Proc_UpdateEmployee (IN p_EmployeeID char(36),
IN p_EmployeeCode varchar(50),
IN p_FullName varchar(100),
IN p_Birthday datetime,
IN p_Gender int(11),
IN p_IdentityCode varchar(25),
IN p_IdentityIssuedDate datetime,
IN p_IdentityIssuedPlace varchar(255),
IN p_Email varchar(50),
IN p_PhoneNumber varchar(50),
IN p_Position int(1),
IN p_Department int(1),
IN p_TaxCode varchar(50),
IN p_JoinDate datetime,
IN p_Salary int(11),
IN p_StatusJob int(1))
SQL SECURITY INVOKER
COMMENT 'Cập nhật thông tin khách hàng'
BEGIN

  UPDATE Employee
  SET EmployeeCode = p_EmployeeCode,
      FullName = p_FullName,
      Birthday = p_Birthday,
      Gender = p_Gender,
      IdentityCode = p_IdentityCode,
      IdentityIssuedDate = p_IdentityIssuedDate,
      IdentityIssuedPlace = p_IdentityIssuedPlace,
      Email = p_Email,
      PhoneNumber = p_PhoneNumber,
      `Position` = p_Position,
      Department = p_Department,
      TaxCode = p_TaxCode,
      JoinDate = p_JoinDate,
      Salary = p_Salary,
      StatusJob = p_StatusJob,
      ModifiedDate = NOW()
  WHERE EmployeeID = p_EmployeeID;
END
$$

